import React, { useState } from 'react'
import AddIcon from '@mui/icons-material/Add';
import Button from '@mui/material/Button';
import DeleteIcon from '@mui/icons-material/Delete';
import TagFacesIcon from '@mui/icons-material/TagFaces';
import { Grid, Paper, Typography } from '@mui/material';
import { Box } from '@mui/system';

export default function ButtonItem() {
    const [ item, setItem] = useState(0);
    const handleClick = () => {
        setItem(count => count + 1);
    };
    const handleReset = () => {
        setItem(0)
    }
    return (
        <>
           <Box
              sx={{
                p: 2,
                bgcolor: 'background.default',
                width: 450,
                justifyContent: 'center',
              }}
            > <Paper elevation={3} sx={{ p:2 }} >
        <Typography variant="h3" className="counter__output">{item}</Typography>
        <Grid >
            <Button variant="outlined" startIcon={<AddIcon />} onClick={handleClick}>
            Add Item
            </Button>
            <Button variant="outlined" startIcon={<DeleteIcon />} onClick={handleReset}>
            Reset
            </Button>
            </Grid>
            </Paper></Box>
        </>
    )
}
